// MenuItem.js
import React from 'react';

const MenuItem = ({ name, description, price }) => {
  return (
    <div className="mb-2"> {/* Adjust margin bottom here */}
      <h3 className="text-lg font-semibold text-[#526C3F]">{name}</h3>
      <p className="text-base text-[#474B4E]">{description}</p>
      <p className="text-base font-bold text-[#526C3F]">{price}</p>
    </div>
  );
};

export default MenuItem;
